<body>
<script>
   let nums=[5,8,1,6,4,9,4,5,3]
    var containsDuplicate = function(nums) {
        let temp=0;
        for(let i=0;i<nums.length;i++){
            for(let j=i;j<nums.length;j++){
                if(nums[j]<nums[j-1]){
                    temp= nums[j];
                    nums[j]=nums[j-1];
                    nums[j-1]=temp;
                }
            }
        }
        console.log(nums);
        return nums;
    };
   containsDuplicate(nums)
</script>
</body>
